import React from 'react';
import logo from './logo.svg';
import './App.css';

function UserProfile() {
  return (
    <div id="userNameBody">
      <img className="logo" src="logo.png" width="100px" height="100px"/>
    </div>
  );
}
function HistoryBar() {
  return (
    <div>
      Hello
    </div>
  );
}

function BackButton() {
  return (
    <div>
      Hello
    </div>
  );
}

function ProfileSideBar() {
  return (
    <div>
      <UserProfile />
    </div>
  );
}

function App() {
  return (
    <div className="App">
      <ProfileSideBar />
    </div>
  );
}

export default App;
